INSERT INTO `notice` (`id`, `category_id`, `title`, `description`, `image`, `date`) VALUES
(4, 5, 'Mariela Peyregne: 25 años jugando con Dabber', '<p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">“En 1991 unos amigos me invitaron a probar un deporte nuevo. Nunca imaginé que sería el inicio de mi pasión por el Padel y que, años después, crecerían en mí las ganas de enseñar.</p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">Mi papá me regaló mi primera paleta. El trabajaba a la vuelta de a fábrica de Dabber y un día me propuso que fuéramos a elegir una paleta para mí. No puedo evocar el modelo que era, pero sé que era un poco más anchas que las palas de ese momento y que era una edición limitada.</p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">Comencé compitiendo en 6ta categoría hasta que en 1994 arranqué mi carrera en el circuito profesional de Padel argentino. En ese lapso, me dediqué a estudiar educación física y mas tardé me convertí en Entrenadora de la Selección de menores de la Asociación Platense de Padel. Fue entonces cuando Dabber me obsequio un nuevo modelo.</p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">22 años jugando en Primera en el Circuito Profesional Argentino, jugadora Top Ten desde 1998, Nº del Ranking Nacional en 2000, 2003 y 2009. Participé con Dabber en tres mundiales. Fui Campeona del Mundo en 2012 y subcampeona en 2000 y 2010.</p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">Agradezco a Dabber por acompañarme todos estos años en mi carrera. Tuve la suerte de encontrarlos, los elegí y luego Dabber me eligió a mí. Gracias por estos 25 años juntos. ¡Vamos por más!”</p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);"><br></p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);"><img src="data:image/jpeg;base64," style="width: 700px;"><br></p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);"><img src="data:image/jpeg;base64," style="width: 700px;"><br></p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);"><img src="data:image/jpeg;base64," style="width: 700px;"><br></p>', '14939901388375.jpg', '2017-05-05 15:15:38');
INSERT INTO `notice` (`id`, `category_id`, `title`, `description`, `image`, `date`) VALUES
(5, 4, 'Ganador del Concurso “Una selfie con tu Dabber”', '<p><span style="color: rgb(115, 115, 115); font-family: Lato; line-height: 20.8px;">David de Frutos Lucas (España) resultó ganador del concurso “Una Selfie con tu Dabber”, certamen en el que se solicitaba a los particpantes que subieran una foto personal con su pala y luego consiguieran votos de sus amigos. La foto de David ganó el primer puesto con 189 votos. El premio conseguido es una Pala Pampa DX2 (Línea Europea, 2015).</span><br></p><p><span style="color: rgb(115, 115, 115); font-family: Lato; line-height: 20.8px;"><img src="data:image/jpeg;base64," style="width: 1160px;"><br></span></p>', '14939901799944.jpg', '2017-05-05 15:16:19');
INSERT INTO `notice` (`id`, `category_id`, `title`, `description`, `image`, `date`) VALUES
(6, 6, 'Beach Tennis', '<p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);"><strong style="line-height: inherit;"><img src="data:image/jpeg;base64," style="width: 776px;"><br></strong></p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);"><strong style="line-height: inherit;">Fuente: </strong><a href="http://www.aatenis.com.ar/es/beach-tennis.php" target="_blank" style="color: rgb(146, 169, 183); line-height: inherit; outline: 0px; transition: all 0.2s ease-in-out;">http://www.aatenis.com.ar/es/beach-tennis.php</a></p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">El Beach Tennis se basa en el tenis, utilizando de forma adaptada sus elementos fundamentales: paletas similares a las de padel, pero más largas y con menor espesor; pelotas de baja presión y una red de 1,70 mts. de altura, sobre una superficie de arena.</p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">El beach tennis, regido a nivel mundial por la Federación Internacional de Tenis, es una variante del tenis que resulta de fácil participación para todo tipo de público, tanto en forma recreativa como profesional.</p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">Se vienen las palas Dabber para Beach Tennis<br>Aquí un adelanto para que vayan saboreando</p>', '14939902528769.jpg', '2017-05-05 15:17:32');

