(2, 'Dabber Conic', '<span style="color: rgb(115, 115, 115); font-family: Lato;">Perfil: 30 mm a 38mm</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><span style="color: rgb(115, 115, 115); font-family: Lato;">Superficie: Rugosa</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><span style="color: rgb(115, 115, 115); font-family: Lato;">Núcleo: DES – Dabber Eva Soft</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><span style="color: rgb(115, 115, 115); font-family: Lato;">Materiales: DC G+GSP2 – Dabber Composite Fibra de vidrio + Grafito SP2</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><span style="color: rgb(115, 115, 115); font-family: Lato;">Marco: Tubular doble tejido DC G+GSP2</span><span class="text_exposed_show" style="color: rgb(115, 115, 115); font-family: Lato;"><br>Geometría: Lagrima Invertida<br>Corazón: Tipo estrella de tres puintas<br>Agujeros: MFHS – 68<br>Grip: Poliuretano microporoso coagulado en frío de baja densidad súper absorbente esxtra confort<br>Nivel: Elite</span>', '14934774398081.jpg', '1493477439976.jpg', 1, NULL, '', 7, 0, '', 'Palas inferior', '<p><br></p>', 5, NULL),
(3, 'Dabber Euphoria DC6', '<p>c</p>', '14934774535705.jpg', '14934774536044.jpg', 1, NULL, '', 9, 0, '', 'Palas superior', '<p><br></p>', 8, NULL),
(4, 'Dabber Max D5', '<p>d</p>', '1493477467902.jpg', '14934774679095.jpg', 1, NULL, '', 4, 0, '', 'Palas superior', '<p><br></p>', 3, NULL),
(5, 'Rober 12', '<p>Descripcion Rober 12</p>', '14934776585811.jpg', '14934776585990.jpg', 1, NULL, '', 5, 0, '', 'Palas superior', '<p><br></p>', 7, NULL),
(6, 'Rober 8 - Multicolor', '<p>Rober 8 - Multicolor</p>', '14934779091069.jpg', '1493477909571.jpg', 1, NULL, '', 3, 0, '', 'Palas inferior', '<p><br></p>', 5, NULL),
(7, 'Cónica', '<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod <span style="line-height: 1.42857;">tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, </span><span style="line-height: 1.42857;">quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo </span><span style="line-height: 1.42857;">consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse </span><span style="line-height: 1.42857;">cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non </span><span style="line-height: 1.42857;">proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p><p><span style="line-height: 1.42857;"><br></span></p><p><span style="line-height: 18.5714px;">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod </span><span style="line-height: 1.42857;">tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, </span><span style="line-height: 1.42857;">quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo </span><span style="line-height: 1.42857;">consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse </span><span style="line-height: 1.42857;">cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non </span><span style="line-height: 1.42857;">proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span><span style="line-height: 1.42857;"><br></span></p>', '14934776853554.jpg', '1493477685594.jpg', 1, NULL, '', 7, 0, '', 'Palas inferior', '<p><br></p>', 4, NULL),
(8, 'Cóndor Evo', '<p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">La Cóndor Evo, como su nombre lo indica, es la evolución del conocido modelo Cóndor. Tomando como base aquella pala se creó este nuevo molde resaltando aún mas los atributos de su antecesora. Su forma de gota invertida desplaza levemente el punto dulce de la pala hacia arriba brindando una mayor potencia en cada impacto y el nuevo material GSP2 incrementa la elasticidad del composite.</p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);"><strong style="line-height: inherit;">Perfil:</strong> 38mm<br><strong style="line-height: inherit;">Superficie:</strong> Rugosa<br><strong style="line-height: inherit;">Núcleo:</strong> DES – Dabber Eva Soft<br><strong style="line-height: inherit;">Materiales:</strong> DC G+GSP2 – Dabber Composite Fibra de vidrio + Grafito SP2<br><strong style="line-height: inherit;">Marco:</strong> Tubular doble tejido DC G+GSP2<br><strong style="line-height: inherit;">Geometría:</strong> Lagrima Invertida<br><strong style="line-height: inherit;">Corazón:</strong> Tipo estrella con punta central redondeada<br><strong style="line-height: inherit;">Agujeros:</strong> MFHS – 68<br><strong style="line-height: inherit;">Grip:</strong> Poliuretano microporoso coagulado en frío de baja densidad súper absorbente<br><strong style="line-height: inherit;">Nivel:</strong> Profesional</p>', '14934777014683.jpg', '14934777012800.jpg', 1, NULL, '', 5, 0, '', 'Palas inferior', '<p><br></p>', 8, NULL),
(9, 'D2', '<p><span style="color: inherit;"><strong style="line-height: inherit; font-family: Lato;">Composición:</strong><span style="font-family: Lato;"> 100% DC G+GSP2 (Dabber Composite Fibra de vidrio + Grafito SP2)</span><br style="font-family: Lato;"><span style="font-family: Lato;">Palo de gama Inicial de DABBER. Es un palo dirigido a las primeras etapas de aprendizaje de Hockey, puede ser perfectamente el “primer palo” reemplazando a los basicos de Madera, o bien puede ser el que reemplace a estos últimos, cuando el/la jugador/a ya empieza a buscar un mayor rendimiento y calidad de golpe de parte de su palo. Palo ligero de peso, su diseño estilizado y recto es asi para que ayudar al jugador a desarrollar y aprender los gestos tecnicos de la mejor manera, sin interferencia de parte de las caracteristicas propias del palo. Posee una potencia ideal para esta etapa.</span><br style="font-family: Lato;"><strong style="line-height: inherit; font-family: Lato;">Peso:</strong><span style="font-family: Lato;"> Light / Medium</span><br style="font-family: Lato;"><strong style="line-height: inherit; font-family: Lato;">Medidas:</strong><span style="font-family: Lato;"> 28” a 37,5”</span></span><br></p>', '14943077692192.jpg', '14943077691857.jpg', 0, NULL, '2', 5, 0, '', 'Nivel ELITE', '<p><br></p>', 7, NULL),
(10, 'D1', '<p><strong style="line-height: inherit; color: rgb(115, 115, 115); font-family: Lato;">Composición:</strong><span style="color: rgb(115, 115, 115); font-family: Lato;"> 100% DC G+GSP2 (Dabber Composite Fibra de vidrio + Grafito SP2)</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><span style="color: rgb(115, 115, 115); font-family: Lato;">Palo de gama Inicial de DABBER. Es un palo dirigido a las primeras etapas de aprendizaje de Hockey, puede ser perfectamente el “primer palo” reemplazando a los basicos de Madera, o bien puede ser el que reemplace a estos últimos, cuando el/la jugador/a ya empieza a buscar un mayor rendimiento y calidad de golpe de parte de su palo. Palo ligero de peso, su diseño estilizado y recto es asi para que ayudar al jugador a desarrollar y aprender los gestos tecnicos de la mejor manera, sin interferencia de parte de las caracteristicas propias del palo. Posee una potencia ideal para esta etapa.</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><strong style="line-height: inherit; color: rgb(115, 115, 115); font-family: Lato;">Peso:</strong><span style="color: rgb(115, 115, 115); font-family: Lato;"> Light / Medium</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><strong style="line-height: inherit; color: rgb(115, 115, 115); font-family: Lato;">Medidas:</strong><span style="color: rgb(115, 115, 115); font-family: Lato;"> 28” a 37,5”</span><br></p>', '14943078674059.jpg', '14943078673056.jpg', 0, NULL, '4', 3, 0, '', '', '<p><br></p>', 2, NULL),
(11, 'A1', '<p><strong style="line-height: inherit; color: rgb(115, 115, 115); font-family: Lato;">Composición:</strong><span style="color: rgb(115, 115, 115); font-family: Lato;"> 90% Carbono / 10% DC G+GSP2 (Dabber Composite Fibra de vidrio + Grafito SP2)</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><span style="color: rgb(115, 115, 115); font-family: Lato;">Es el palo de más alta gama y composición de la marca Dabber posee un diseño estilizado al máximo, curva pronunciada que facilita la ejecución de arrastradas y flicks, ofreciendo un mayor control sobre el palo.</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><strong style="line-height: inherit; color: rgb(115, 115, 115); font-family: Lato;">Peso:</strong><span style="color: rgb(115, 115, 115); font-family: Lato;"> Light / Medium</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><strong style="line-height: inherit; color: rgb(115, 115, 115); font-family: Lato;">Medidas:</strong><span style="color: rgb(115, 115, 115); font-family: Lato;"> 36” a 37,5”</span><br></p>', '14943079103561.jpg', '14943079101515.jpg', 0, NULL, '', 0, 0, '', 'Nivel ELITE', '<p><br></p>', 0, NULL),
(12, 'M4', '<p><strong style="line-height: inherit; color: rgb(115, 115, 115); font-family: Lato;">Composición:</strong><span style="color: rgb(115, 115, 115); font-family: Lato;"> 40% Carbono / 60% DC G+GSP2 (Dabber Composite Fibra de vidrio + Grafito SP2)</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><span style="color: rgb(115, 115, 115); font-family: Lato;">Palo de gama Intermedia de DABBER. Posee identica silueta al modelo A1 y A2, pero con inferior porcentaje de Carbono. Palo ultraligero gracias a su diseño estilizado, y su robustez lo convierte en un palo de buena potencia.</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><strong style="line-height: inherit; color: rgb(115, 115, 115); font-family: Lato;">Peso:</strong><span style="color: rgb(115, 115, 115); font-family: Lato;"> Light / Medium</span><br style="color: rgb(115, 115, 115); font-family: Lato;"><strong style="line-height: inherit; color: rgb(115, 115, 115); font-family: Lato;">Medidas:</strong><span style="color: rgb(115, 115, 115); font-family: Lato;"> 36” a 37,5”</span><br></p>', '14943079812139.jpg', '14943079811883.jpg', 0, NULL, '4', 5, 0, '', 'Nivel ELITE', '<p><br></p>', 8, NULL),
(15, 'Tuga', '<p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 20.8px; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">Pala exclusiva de <a href="http://www.padelnuestro.es/" target="_blank" style="color: rgb(146, 169, 183); line-height: inherit; outline: 0px;">Padel Nuestro</a></p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 20.8px; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">Sin dudas otra pala con excelente relación Potencia/Control de Dabber. La Tuga 2014 es una pala especial para jugadores dinámicos que basan su juego en la velocidad de movimiento de la misma. Su marco chaflanado da una geometría aerodinámica que brinda ligereza a la hora de los movimientos.</p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 20.8px; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);"><strong style="line-height: inherit;">Perfil:</strong> 38mm<br><strong style="line-height: inherit;">Superficie:</strong> Rugosa<br><strong style="line-height: inherit;">Núcleo:</strong> DES – Dabber Eva Soft<br><strong style="line-height: inherit;">Materiales:</strong> DC G+G – Dabber composite Fibra de vidrio + Grafito<br><strong style="line-height: inherit;">Marco:</strong> Tubular doble tejido DC G+G<br><strong style="line-height: inherit;">Geometría:</strong> Redonda<br><strong style="line-height: inherit;">Corazón:</strong> Tipo estrella de tres puntas simétrica con bordes achaflanados<br><strong style="line-height: inherit;">Agujeros:</strong> MFHS – 69<br><strong style="line-height: inherit;">Grip:</strong> Poliuretano microporoso coagulado en frío de baja densidad súper absorbente.<br><strong style="line-height: inherit;">Nivel:</strong> Avanzado</p>', '14943582728943.jpg', '14943582723664.jpg', 0, NULL, '5', 4, 0, '', 'Nivel ELITE', '<p><br></p>', 7, NULL),
(16, 'Sur', '<p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 20.8px; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">Pala exclusiva de <a href="http://www.padelnuestro.es/" target="_blank" style="color: rgb(146, 169, 183); line-height: inherit; outline: 0px;">Padel Nuestro</a></p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 20.8px; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);">La Dabber Sur 2014 sin dudas es un prodigio en cuanto a potencia. En esta pala el caso que la superficie sea rugosa ayuda claramente a incrementar el control. Los cambios para este 2014 permitieron una notable reducción en las vibraciones mejorando a las claras el control.</p><p style="margin-bottom: 1.25rem; padding: 0px; font-family: Lato; line-height: 20.8px; text-rendering: optimizeLegibility; color: rgb(115, 115, 115);"><strong style="line-height: inherit;">Perfil:</strong> 38mm<br><strong style="line-height: inherit;">Superficie:</strong> Rugosa<br><strong style="line-height: inherit;">Núcleo:</strong> DES – Dabber Eva Soft<br><strong style="line-height: inherit;">Materiales:</strong> DC G+G – Dabber composite Fibra de vidrio + Grafito<br><strong style="line-height: inherit;">Marco:</strong> Tubular doble tejido DC G+G<br><strong style="line-height: inherit;">Geometría:</strong> Diamante<br><strong style="line-height: inherit;">Corazón:</strong> Tipo estrella de tres puntas simétrica con bordes achaflanados<br><strong style="line-height: inherit;">Agujeros:</strong> MFHS – 72<br><strong style="line-height: inherit;">Grip:</strong> Poliuretano microporoso coagulado en frío de baja densidad súper absorbente<br><strong style="line-height: inherit;">Nivel:</strong> Avanzado</p>', '14943584036462.jpg', '14943584037166.jpg', 1, NULL, '', 3, 4, '', 'Palas inferior', '<p><br></p>', 2, NULL);

