(1, 'Quienes Somos', '<div>Nuevo Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Casa<br></div>', 'quienes-somos', 'Contenido de la página Quienes somos'),
(2, 'Terminos y Condiciones', '<div id="" class="rw vc_row-fluid ">\r\n	<div class="medium-12 small-12  columns ">\r\n			\r\n	<div class="wpb_text_column wpb_content_element ">\r\n		<div class="wpb_wrapper">\r\n			<h4>Garantía de palas DABBER</h4>\r\n<p>DABBER es una marca registrada, que a través de Dabber Europa S.L. como responsable del mercado Europeo, distribuye sus productos por medio de distribuidores oficiales, entendiendo como tales aquellos comerciales, tiendas y clubes que tienen firmado un contrato de distribución con Dabber Europa S.L.</p>\r\n<h4></h4>\r\n\r\n		</div> \r\n	</div> \r\n	</div> \r\n</div><div id="" class="rw vc_row-fluid ">\r\n	<div class="medium-12 small-12  columns ">\r\n			\r\n	<div class="wpb_text_column wpb_content_element  wpb_animate_when_almost_visible wpb_top-to-bottom">\r\n		<div class="wpb_wrapper">\r\n			<h4>Garantía</h4>\r\n<p>Este producto está garantizado por un periodo de 6 (seis) meses contados a partir de la fecha de compra. Esta garantía cubre defectos de fabricación y/o materiales durante la vigencia de la misma,  exceptuando la rotura y o perjuicios derivados de un mal uso del producto, tales como golpes contra elementos que no sean la propia pelota del juego, raspones, agrietamiento de pintura, exposición del  producto a temperaturas inferiores a los -10°C y superiores a los 45°C, atmósferas con solventes y/o inmersiones en líquidos. La garantía tendrá validez unicamente acompañada de la factura de compra  y de la activación del producto a través de www.dabberspor.com. La misma caducará automáticamente si se le efectuara a la pala modificaciones, reparaciones y/o agregados que no hayan sido  expresamente autorizados por Dabber. Esta garantía no cubrirá los gastos originados por el envío de la pala a nuestras oficinas como ningún gasto o perjuicio derivado directa o indirectamente de la  misma.</p>\r\n<h4></h4>\r\n\r\n		</div> \r\n	</div> \r\n	<div class="wpb_text_column wpb_content_element ">\r\n		<div class="wpb_wrapper">\r\n			<h4>Condiciones generales de garantía</h4>\r\n<p>Toda acción de reclamo deberá acompañarse por:<br>\r\n– Ticket o factura de compra<br>\r\n– Confirmación de activación de garantía<br>\r\n1. Haber comprado la pala en tiendas y establecimientos autorizados por la marca.<br>\r\n2. Validación del producto a través de la web www.dabbersport.com, en un plazo máximo de 20 días naturales posteriores a la compra del mismo. Al realizar esta acción recibirá un correo electrónico desde el departamento de garantías de Dabber confirmando la garantía. Si el cliente adquiere una pala Dabber pero no la registra en la web o pasado el tiempo para la activación, la fecha de punto de partida para la garantía de la pala será la que indique el ticket de compra.<br>\r\n3. Poseer ticket o factura de compra del producto.<br>\r\n4. En caso de venta en mercado de segunda mano, será obligatorio el aviso a garantias@dabbersport.com para el traspaso de la garantía. Junto a la pala vendida se deberá transmitir el ticket de compra original y copia del mail de activación.<br>\r\n5. Se hara efectivas el cambio por defecto de la siguiente manera:<br>\r\n5.a. Si el defecto de fabricación ocurre en los primeros 30 días desde la fecha de compra, el cliente deberá acudir al establecimiento donde adquirió el producto para evaluar si los daños o defectos son cubiertos por la garantía. El establecimiento elevará la solicitud a Dabber Europa donde se autorizará o denegará el cambio del mimo.<br>\r\n5.b. Si el defecto de fabricación ocurre posterior a los 30 días y hasta los 6 meses desde la fecha de compra, el cliente deberá iniciar el reclamo remitiendose a Dabber a través de garantias@dabbersport.com indicando el código de producto.</p>\r\n\r\n		</div> \r\n	</div> \r\n        </div> </div>', 'termino-servicio', 'Contenido de la página Terminos y Servicios'),
(3, 'Contacto Dabber España', '<div class="large_title upper-text">DABBER<br>ESPAÑA</div>\r\n<p>Av. 66 nº 2679<br>\r\n(B1910GFE)<br>\r\nLa Plata. Buenos Aires.<br>\r\nArgentina</p>\r\n<p>Tel: + 54 221 450 9808<br>\r\nTel: + 54 221 450 9194<br>\r\nventas@dabbersport.com</p>', 'contact-dabber-espanna', 'Contenido del contacto para dirección y telefonos'),
(4, 'Método efectivo', 'Descripción de la información de la cuenta en banco y toda la información que es necesario mostrar al cliente para que el pedido se pueda realizar<br>', 'method-effective', 'Explicación al cliente para compra por pago en efectivo'),
(5, 'Método de reembolso', 'Aqui estaria una descripcion de este método y los datos del banco, todo es configurabale desde el menu Texto<div>en la administracccion.</div>', 'method-repayment', 'Descripción del método Reembolso y de los datos del banco'),
