INSERT INTO `technology` (`id`, `title`, `content`, `image`) VALUES
(6, 'DES', '<p>Núcleo co-polimérico reticulado de celda cerrada, de gran resistencia y flexibilidad. Gran poder de absorción a las vibraciones permitiendo aumentar significativamente el control. Mayor memoria de recuperación incrementando la potencia.<br></p>', '14939895519599.png'),
(7, 'DF', '<p>Núcleo co-polimérico reticulado de celda abierta, super blando. Excelente absorción a las vibraciones siendo utilizado para modelos que requieren control extremo.<br></p>', '1493989583617.png'),
(8, 'DC3K', 'La Fibra de Carbono DC3K recubre toda la superficie de la pala aumentando su resistencia mecánica con un modulo de elasticidad elevado. De esta manera en<br>combinación con el núcleo DES proporcionan una excelente transmisión de de fuerza en el golpeo de la bola.<br>', '14939896258503.png'),
(9, 'RUGGED SURFACE', '<p>La superficie rugosa en las palas es una característica única de Dabber, la misma es conformada desde el proceso de laminación. Permite incrementar la fuerza de rozamiento sobre la bola proporcionando un efecto distinto al de las palas de superficie lisa.<br></p>', '14939897027909.png'),
(10, 'DC G+G', '<p>Composite formado por Fibra de Vidrio y Grafito, proporciona una estructura similar a la del Carbono con diferente respuesta al esfuerzo mecánico. Da a la pala una excelente resistencia al impacto debido también a su innovador proceso de laminado.<br></p>', '14939897256464.png'),
(11, 'CENTRAL BALANCE', '<p>Balance central tanto en el eje vertical como horizontal, que permite una excelente sensación de confort al tener la pala en la mano. Esto se logra desde el momento del diseño de la pala y su posterior aplicación en el proceso de laminación.<br></p>', '14939897536951.png'),
(12, 'DID', '<p>El diseño integral de Dabber genera morfologías y estructuras en sus exclusivos modelos para las diferentes exigencias de los jugadores. El mismo se centra en un estilo único a partir de conceptos como el dinamismo, eficiencia y ligereza.<br></p>', '14939897791674.png'),
(13, 'MFHS', '<p>Mirror frame holes system. Agujeros que siguen el contorno del marco aumentando la flexión del parche y su vida útil.<br></p>', '14939898189213.png'),
(14, 'GSP2', '<p>Grafito de segunda generación con excelente recuperación elástica. Debido al innovador proceso de laminado, reduce las tensiones superficiales provocando una mayor flexión del parche sin comprometer su dureza estructural.&nbsp;<br></p>', '14939898452382.png');

